import React from 'react'
import { useSelector } from 'react-redux';

import { selectIsSelectedLinkItemList } from '../navBarList/navBarSlice'

import '../../features/linkItemList/linkItemListStyle.css'

const LinkItemList = () => {
  const linkItemList = useSelector(selectIsSelectedLinkItemList)
  
  // className='linkItemList'
  return (    
    <div className='navBarList scroll'>
      {linkItemList?.map(navItem => (     
        <div key={navItem.navItemKey}>
          <linkItemList title={navItem.title} navItemKey={navItem.navItemKey}></linkItemList>
        </div>           
      ))}
    </div>
  )
}

export default LinkItemList
